Overview

The Business Analyst, Marketing will lead and execute the end-to-end analytics process for marketing campaigns across all of our brands – Memphis Grizzlies, Memphis Hustle, FedExForum, Grizz Gaming, and Grind City Media. This individual should possess strong analytical skills, including knowledge of A/B and multivariate testing, financial modeling, and statistical methods. The Business Analyst, Marketing should be well-versed in the intricacies and dynamics of working with marketing data and will be responsible for providing qualitative and quantitative analysis, testing and measurement, report building, and data systems technical support for all our brands.

The Business Analyst, Marketing will understand the demographics of our fans, their journeys as they interact with our brands, and the drivers that influence them to purchase. Additionally, the Business Analyst, Marketing will represent the Marketing department as part of the cross-functional Business Strategy and Analytics team.

Responsibilities
Lead analytics projects, applying a wide range of methodologies to support decision-making in Marketing initiatives;
Audit, administer, and manage analytics platforms including Google Tag Manager, Google Analytics, and Adobe Analytics;
Maintain, mine, and query internal databases to perform comprehensive campaign analyses;
Become subject matter expert in Marketing database, ensuring accurate data feeds and proactively troubleshooting when issues arise;
Create, enhance, and manage Marketing Dashboards utilizing Datorama and Tableau including ad performance and brand insights reports;
Create Marketing lists for email, CRM, social and mobile campaigns;
Provide strategic marketing recommendations and insights based on analysis in a clear and visually-compelling nature;
Support organizational efforts to identify, understand, and pursue critical customer segments and understand consumer journey;
In conjunction with Marketing stakeholders, develop and maintain testing strategy – to include deploying a combination of A/B and multivariate tests for campaigns, web and mobile;
M easure, track, and report on key performance indicators across Marketing channels;
Develop thorough understanding of Memphis DMA (demographics, purchase behaviors, growth trends, etc.) through primary and secondary research;
Manage, support, and troubleshoot issues with the Datorama Marketing Data Warehouse;
Obtain and ingest reports from marketing channel partners (radio and TV stations, agencies, etc.) on campaign performance;
Work with existing vendors to ensure accurate delivery of data;
Provide ad hoc analysis in Marketing as required;
Other duties as assigned.

Qualifications

Required:
Bachelor’s degree, preferably in business, marketing, mathematics or related field.
A minimum of three years’ experience in marketing analytics, preferably with an eCommerce brand, sports team, or ad agency.
Expertise in Google Tag Manager and Google Analytics, up-to-date in all Google certifications.
Experience utilizing digital marketing and analytics platforms to access and manage reporting (i.e. Adobe Analytics, Google AdWords, Native and Third Party Social Media analytics).
Experience with A/B and multivariate testing and multi-channel (online and offline) attribution.
Experience with Ticketmaster platforms (TM ONE, Account Manager, etc.).
Ability to work with data visualization software (Tableau and Datorama strongly preferred).
High level of business acumen, creative problem-solving abilities, and professionalism.
Ability to interact with and present to senior-level executives and clients.
Tremendous teamwork and collaborative spirit coupled with the ability to work independently.
Self-motivated and solutions oriented.
The capacity to multi-task and juggle competing priorities .

Preferred
3-5 years’ experience with Salesforce Marketing Cloud and Datorama strongly preferred.
Proficiency in one scripting language (SQL or R preferred).
1-2 years’ experience with Salesforce Marketing Cloud and Datorama.
Previous experience with Ticketmaster’s Archtics platform.
Deep understanding of Scarborough Research Data.
Demonstrated knowledge of survey design and analysis methodologies.

