Senior Data Financial Analyst

PAE has an opening for a Senior Financial Data Analyst to support the US Attorney's Office in Washington, DC.

Shall provide independent support for miscellaneous audit and statistical analysis. Tasks may include:
Use database tools to extract, analyze, summarize and create visualizations of data from complex and varied datasets;
Develop databases, statistical tools and methods to analyze healthcare claims, procedure codes, other data and evidence for potential fraud for civil and criminal matters;
Create, implement, analyze and present statistically valid random sampling plans and methodologies, and review plans developed by other experts;
Develop statistically valid damages models;
Develop computerized models to assist in the presentation of data;
Communicate findings to attorneys and investigators;
Work with independent experts;
Conduct trainings on sampling methodologies and advanced data manipulation and visualization.
Minimum Qualifications
Must be able to obtain and maintain a US government security clearance.
Bachelor of Science degree in accounting, statistics, economics or similar field required; Master’s degree strongly preferred.
Minimum of 8 years of relevant experience in litigation consulting and/or health care fraud analysis, including supporting criminal and civil investigations required.
Knowledge of accounting and auditing principles required.
Ability to perform all analyzes, calculations, and simulations using code written using SAS software or similar; advanced Excel, Access and other database skills required.
Strong analytical, technical, interpersonal, and communication skills required.
Must be able to work individually as well as in teams. Must have experience managing people in a team environment.
